Competitive Edge - Phaser 6000
- The Phaser 6000 colour printer is faster than other printers in its class;
- A smaller footprint means you can locate the Phaser 6000 where itu2019s most convenient;
- Proven Hi-Q LED print engine consumes low energy and space and produces low noise.

Print Quality Features - Phaser 6000
- Hi-Q LED print engine uses the same breakthrough technology found in some of our higher-end graphic arts devices;
- A print resolution of 1200 x 2400 dpi delivers an amazing 16 shades of colour per pixel. That means a wider colour range for more impressive business graphics;
- Unique Xerox EA Eco toner technology gives you crisp text and printed images with superior detail and clarity. Itu2019s the same high-quality toner used in our professional graphic-arts colour devices.

Reliability and Ease-of-use Features - Phaser 6000
- Print on everything from labels to cardstock to envelopes;
- Outstanding reliability is backed by Xerox with a one-year on-site warranty;
- Easy installation and pre-loaded toner cartridges make this printer virtually plug-and-play.

Productivity Features - Phaser 6000
- The value-packed Phaser 6000 colour printer means business for your desktop, providing real-world print productivity and a host of built-in features;
- Superior performance gets your jobs out quickly, with print speeds as fast as 10 ppm for colour and 12 ppm for black-and-white;
- A 192 MHz processor and 64 MB standard memory handle your daily workload u2014 even pages with graphics, photos and charts.

Software Solutions - Phaser 6000
Digitize . . . Organize . . . Distribute . . . Collaborate.
With digital documents, you can easily create, search, re-use, and build upon your documents. Maximize your hardware investments with innovative software solutions from Xerox and Xerox Business Partners:
- Contain costs;
- Share knowledge;
- Accelerate workflow;
- Integrate paper and electronic documents;
- Manage and distribute documents effectively.
